(19779, 2694, '_form', '<div class=\"mh-contact-form-style-2\">\n<label>Address</label>[text address]\n\n<label>City</label>[text city]\n\n<label>State</label>[text state]\n\n<label>Zip Code</label>[text zipcode]\n\n<label>Property Type</label>[select* menu-8 \"Apartment\" \"House\" \"Loft\"]\n\n<label>Condition of Property</label>[radio radio-160 \"Good\" \"Excellent\" \"Fair\" \"Needs work\" \"Poor\"] \n\n<label>Bedrooms</label>[radio radio-161 default:1 \"1\" \"2\" \"3\" \"4\" \"5+\"] \n\n<label>Bathrooms</label>[radio radio-162 default:1 \"1\" \"2\" \"3\" \"4\" \"5+\"]\n\n<label>Additional rooms/features</label>[textarea textarea-67 placeholder \"Please list additional rooms and describe any special features and recent upgrades. For example: new carpet, property near a park, etc.\"]\n\n<label>Approximate Size (square feet)</label>[text approx-size] \n\n<label>Approximate Age of Kitchen (years)</label>[text approx-agekitchen] \n\n<label>Approximate Age of Baths (years)</label>[text approx-agebaths] \n\n<br>\n\n<h2>Personal Info</h2>\n\n<label>Name*</label>[text* your-name]\n\n<label>Email* (required)</label>[email* your-email]\n\n<label>Phone* (required)</label>[tel* tel-230] \n\n<label>Select a Service* (required)</label>[radio radio-761 default:1 \"Sale\" \"Rent\" \"Either\"]\n\n<label>Subject</label>[text your-subject] \n\n<label>Comments</label>[textarea your-message] \n\n[submit \"Send request\"]\n</div>'),
