(575, 2, '2017-10-04 11:00:05', '2017-10-04 11:00:05', 'How the adventure ended will be seen anon. Aouda was anxious, though she said nothing. As for Passepartout, he thought Mr. Foggs manoeuvre simply glorious. The captain had said between eleven and twelve knots, and the Henrietta confirmed his prediction.\r\n\r\nIf, thenfor there were ifs stillthe sea did not become too boisterous, if the wind did not veer round to the east, if no accident happened to the boat or its machinery, the Henrietta might cross the three thousand miles from New York to Liverpool in the nine days, between the 12th and the 21st of December. It is true that, once arrived, the affair on board the Henrietta, added to that of the Bank of England, might create more difficulties for Mr. Fogg than he imagined or could desire.\r\n\r\nDuring the first days, they went along smoothly enough. The sea was not very unpropitious, the wind seemed stationary in the north-east, the sails were hoisted, and the Henrietta ploughed across the waves like a real trans-Atlantic steamer.', 'Medical office condo', '', 'publish', 'closed', 'closed', '', 'medical-office-condo', '', '', '2018-08-26 15:32:11', '2018-08-26 15:32:11', '', 0, 'http://localhost/newhome/?post_type=estate&#038;p=575', 0, 'estate', '', 0),
